const FilterByName = (props) => {
    const handleChange = (ev) => {
        props.handleFilter({ key: "name", value: ev.target.value });
    };
    return ( <
        form >
        <
        label className = ""
        htmlFor = "name" >
        Filtrar por nombre:
        <
        /label> <
        input className = ""
        type = "text"
        name = "name"
        id = "id"
        species = "species"
        onChange = { handleChange }
        /> <
        /form>
    );
    event.preventDefault();
};

export default FilterByName;
